import React, { Component } from 'react';
import "./Enemy.css";

class Enemy extends Component {
    // constructor(props) {
    //     super(props);
    //     this.state = {
    //         enemyCurrentStats: this.enemyStats,
    //     }
    // }

    render() {
        return (
            <div>
            <div className="enemy-items__container">
                {this.props.items.map((item, index) =>
                    <img className={item.zip} key={`enemy-items-${index}`} src={item.src} alt={item.name}/>
                )}
            </div>
            <div className="enemy-stats__container">
                {this.props.enemyStats.map((item, index) =>
                    <div key={`enemy-stats-${index}`}> {item.text} ":" {item.value}
                    </div>
                )}
            </div>
            </div>
        );
    }
}

export default Enemy;
